import styled from 'styled-components';

export default function Command () {
    return(
        <Page>
            <Button><ButtonText>Kill Me</ButtonText></Button>
        </Page>
    );
}

const Page = styled.div`
    background-color: black;
    width: 100%;
    height: 100vh;
    display: flex;
    justify-content: center;
    align-items: center;
`;

const Button = styled.div`
    width: 240px;
    height: 50px;
    background-color: red;
    border-radius: 8px;
    display: flex;
    justify-content: center;
    align-items: center;
    font-size: 16px;
    font-family: 'Montserrat';
    :hover {
        border-radius: none;
        transition: 300ms;
    }
`;

const ButtonText = styled.p`
    color: white;
`;
